6	todas as refeições por data	SELECT tb_historico."FKid_usuario" as código, pessoas.nome as nome, tb_historico."FKcod_operador" as vendedor, tb_historico.refeicao_historico as refeição, 'R$ ' || to_char(tb_historico.custo_historico, '0D00') as custo, tb_historico.desconto_historico || ' %' as desconto, 'R$ ' || to_char(tb_historico.preco_historico, '0D00') as preço,to_char(tb_historico.data_historico, 'dd/mm/yyyy') as data, tb_historico.hora_historico as hora FROM public.pessoas, prato.tb_historico  WHERE tb_historico."FKid_usuario" = pessoas.id AND  tb_historico.data_historico>='01-01-2000' AND  tb_historico.data_historico<='31-12-2010' ORDER BY  tb_historico.data_historico,  tb_historico.refeicao_historico,  pessoas.nome
10	os maiores comilões	SELECT tb_historico."FKid_usuario" as código, pessoas.nome as nome, tb_historico.refeicao_historico as refeição, tb_historico.quant_historico as quantidade FROM public.pessoas, prato.tb_historico  WHERE tb_historico."FKid_usuario" = pessoas.id AND  tb_historico.data_historico>='01-01-2000' AND  tb_historico.data_historico<='31-12-2010' AND  tb_historico.refeicao_historico like 'Almoço%' ORDER BY  tb_historico.quant_historico
